class Dot {    // класс для создания снарядов и питард
public:
  byte    show;
  byte    theType;
  accum88 x;
  accum88 y;
  saccum78 xv;
  saccum78 yv;
  accum88 r;
  CRGB color;

  Dot() {
    show = 0;
    theType = 0;
    x =  0;
    y =  0;
    xv = 0;
    yv = 0;
    r  = 0;
    color.setRGB( 0, 0, 0);
  }

  void Draw(CRGB *leds);
  void Move(DOTS_STORE &store);
  void GroundLaunch(DOTS_STORE &store);
  void Skyburst( accum88 basex, accum88 basey, saccum78 basedv, CRGB& basecolor);

};

